// id values will be unique
const items = [
    { name: 'Milk', quantity: 2,  unit: "Oz" },
    { name: 'Watermellon', quantity: 1, unit: "ct" },
	{ name: 'Eggs', quantity: 1 , unit: "dozen"},
	{ name: 'Bread', quantity: 1 , unit: "count"},
];

export default items;
